import React from "react"
import { Checkbox, IconButton, Icon } from "monday-ui-react-core"
import { RecycleBin } from "monday-ui-react-core/icons" 
import { useState, useEffect } from "react";

const ListItem = ({itemName}) => {
    const [isChecked, setIsChecked] = useState(false);

    return (
        <div>
            {isChecked ? <IconButton icon={<Icon iconType={Icon.type.ICON_FONT} icon="fa fa-star"></Icon>}></IconButton> :  <div></div>}
            <Checkbox onChange={() => setIsChecked(!isChecked)} checked={isChecked} disabled={isChecked} label={itemName}></Checkbox>
        </div>
    );
}

export default ListItem
